  return (
    <>
      <div className="featuresDiv">
        <center>
          <h2 className="featuresHeading">

            Our Features

          </h2>
        </center>
        <div className="features">

          <div className="feature">
            
             


          </div>

        </div>
      </div>
    </>
  )
}

export default Features
